import React from "react";

function Mail(props) {
  
  return (
    <div className="page__mail">
      <div>
        Электронная почта
      </div>
      <div>
        <input type="text" name="mail" value={props.value} onChange={props.onChange}/>
      </div>
    </div>
  )
}

export default Mail
